import React, { useState } from 'react';
import clsx from 'clsx';
import PerfectScrollbar from 'react-perfect-scrollbar';
import { withStyles } from '@material-ui/styles';
import {
    Card,
    CardActions,
    CardContent,
    Checkbox,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
    Typography,
    TablePagination
} from '@material-ui/core';
import moment from 'moment';
import { getInitials } from 'helpers';
//import { ToolbarTable } from './components';
import styles from './styles';

const dataDate = [
    {id: '1', ngay: '12/12/2010'},
    {id: '2', ngay: '11/11/2019'},
    {id: '3', ngay: '01/12/2010'},
    {id: '4', ngay: '19/11/2019'}
]

const PresencesTable = props => {
    const { className, classes } = props;
    const [selectedUsers, setSelectedUsers] = useState([]);
    const [rowsPerPage, setRowsPerPage] = useState(5);
    const [page, setPage] = useState(0);

    const handleSelectAll = event => {
        // let selectedUsers;
        // if (event.target.checked) {
        //     selectedUsers = users.map(user => user._id);
        // } else {
        //     selectedUsers = [];
        // }
        // setSelectedUsers(selectedUsers);
    };
    const handleSelectOne = (event, id) => {
        // const selectedIndex = selectedUsers.indexOf(id);
        // let newSelectedUsers = [];
        // if (selectedIndex === -1) {
        //     newSelectedUsers = newSelectedUsers.concat(selectedUsers, id);
        // } else if (selectedIndex === 0) {
        //     newSelectedUsers = newSelectedUsers.concat(selectedUsers.slice(1));
        // } else if (selectedIndex === selectedUsers.length - 1) {
        //     newSelectedUsers = newSelectedUsers.concat(
        //         selectedUsers.slice(0, -1)
        //     );
        // } else if (selectedIndex > 0) {
        //     newSelectedUsers = newSelectedUsers.concat(
        //         selectedUsers.slice(0, selectedIndex),
        //         selectedUsers.slice(selectedIndex + 1)
        //     );
        // }
        // setSelectedUsers(newSelectedUsers);
    };
    const handlePageChange = (event, page) => {
        setPage(page);
    };
    const handleRowsPerPageChange = event => {
        setRowsPerPage(+event.target.value);
        setPage(0);
    };

    return (
        <Card className={clsx(classes.root, className)}>
            {/* <ToolbarTable
                selectedUsers={selectedUsers}
                deleteUsers={deleteUsers}
            /> */}
            <CardContent className={classes.content}>
                <PerfectScrollbar>
                    <div className={classes.inner}>
                        <Table size='small'>
                            <TableHead>
                                <TableRow>
                                    <TableCell rowSpan={2} padding="checkbox" className={classes.borderTable}>
                                        <Checkbox
                                            // checked={
                                            //     selectedUsers.length ===
                                            //     users.length
                                            // }
                                            color="primary"
                                            // indeterminate={
                                            //     selectedUsers.length > 0 &&
                                            //     selectedUsers.length <
                                            //         users.length
                                            // }
                                            onChange={handleSelectAll}
                                        />
                                    </TableCell>
                                    <TableCell rowSpan={2} align='center' className={classes.borderTable}>Member code</TableCell>
                                    <TableCell rowSpan={2} className={classes.borderTable}>Name</TableCell>
                                    <TableCell rowSpan={2} align='center' className={classes.borderTable}>Birth date</TableCell>
                                    <TableCell rowSpan={2} align='center' className={classes.borderTable}>Gender</TableCell>
                                    <TableCell className={classes.borderTable} colSpan={3} align='center'>
                                        ngay kiem dien
                                    </TableCell>
                                </TableRow>
                                <TableRow>
                                    <TableCell align='center' className={classes.borderTable}>11/01/2019</TableCell>
                                    <TableCell align='center' className={classes.borderTable}>11/11/2019</TableCell>
                                    <TableCell align='center' className={classes.borderTable}>11/12/2019</TableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>
                                <TableRow
                                    className={classes.tableRow}
                                    hover
                                    // selected={
                                    //     selectedUsers.indexOf(
                                    //         user._id
                                    //     ) !== -1
                                    // }
                                >
                                    <TableCell padding="checkbox" className={classes.borderTable}>
                                        <Checkbox
                                            // checked={
                                            //     selectedUsers.indexOf(
                                            //         user._id
                                            //     ) !== -1
                                            // }
                                            color="primary"
                                            // onChange={event =>
                                            //     handleSelectOne(event, user._id)
                                            // }
                                            value="true"
                                        />
                                    </TableCell>
                                    <TableCell align='center' className={classes.borderTable}>
                                        <Typography variant="body1">
                                            3115410009
                                        </Typography>
                                    </TableCell>
                                    <TableCell className={classes.borderTable}>Nguyen duc ao</TableCell>
                                    <TableCell align='center' className={classes.borderTable}>20/05/1997</TableCell>
                                    <TableCell align='center' className={classes.borderTable}>Male</TableCell>
                                    <TableCell className={classes.borderTable}>12/12/2019</TableCell>
                                    <TableCell className={classes.borderTable}>12/12/2019</TableCell>
                                    <TableCell className={classes.borderTable}>12/12/2019</TableCell>
                                </TableRow>
                                <TableRow
                                    className={classes.tableRow}
                                    hover
                                    // selected={
                                    //     selectedUsers.indexOf(
                                    //         user._id
                                    //     ) !== -1
                                    // }
                                >
                                    <TableCell padding="checkbox" className={classes.borderTable}>
                                        <Checkbox
                                            // checked={
                                            //     selectedUsers.indexOf(
                                            //         user._id
                                            //     ) !== -1
                                            // }
                                            color="primary"
                                            // onChange={event =>
                                            //     handleSelectOne(event, user._id)
                                            // }
                                            value="true"
                                        />
                                    </TableCell>
                                    <TableCell align='center' className={classes.borderTable}>
                                        <Typography variant="body1">
                                            3115419998
                                        </Typography>
                                    </TableCell>
                                    <TableCell className={classes.borderTable}>Truong tuan dieu</TableCell>
                                    <TableCell align='center' className={classes.borderTable}>12/12/1999</TableCell>
                                    <TableCell align='center' className={classes.borderTable}>Female</TableCell>
                                    <TableCell className={classes.borderTable}>12/12/2019</TableCell>
                                    <TableCell className={classes.borderTable}>12/12/2019</TableCell>
                                    <TableCell className={classes.borderTable}>12/12/2019</TableCell>
                                </TableRow>
                            </TableBody>
                        </Table>
                    </div>
                </PerfectScrollbar>
            </CardContent>
            <CardActions className={classes.actions}>
                <TablePagination
                    component="div"
                    count={2}
                    onChangePage={handlePageChange}
                    onChangeRowsPerPage={handleRowsPerPageChange}
                    page={page}
                    rowsPerPage={rowsPerPage}
                    rowsPerPageOptions={[]}
                    backIconButtonProps={{
                        'aria-label': 'previous page'
                    }}
                    nextIconButtonProps={{
                        'aria-label': 'next page'
                    }}
                    labelRowsPerPage=""
                />
            </CardActions>
        </Card>
    );
};
export default withStyles(styles)(PresencesTable);
